import "../css/Home.css"
import {Link} from 'react-router;com';

const Home = () => {
    return ( 
        <div className="Home">
            <div className="Home-bg"></div>
            <div className="Home-container">
                <h1> Welcome to QuizIt! </h1>
                <p className="p1"> All your study materials, all in one place. </p>
                <p className="p2"> Study flashcards by yourself or with friends, we don't care. </p>
                <button><Link to="/login">Log In </Link></button>
                <button><Link to="/signup">Sign Up</Link></button>
            </div>
        </div>
    )
}

export default Home;
